'use strict';var _ = require('lodash');

describe('argparse', function () {
  var argparse = void 0;

  beforeEach(function () {
    jest.mock('minimist');
    var minimist = require('minimist');
    minimist.mockReturnValue({ test: 'a value' });
    argparse = require('./argparse');
  });

  it('nonexistent key should return undefined result', function () {
    expect(argparse.getArgValue('blah')).not.toBeDefined();
  });

  it('existing key should return a result', function () {
    expect(argparse.getArgValue('test')).toBe('a value');
  });
});